(3, 'Comprobación de correos', 1, 'actas', '2023-06-22 13:45:00', '2023-06-23 16:49:00', 'usuario', '[\"3\"]', 'usuario', '[\"3\"]', '', '', 'null', 'usuario', '[\"5\",\"3\"]', 'usuario', '[\"5\",\"3\"]', '\",,,,,,,,,\"', '\",,,,,,,,,\"', '\",,,,,,,,,\"', '\",,,,,,,,,\"', '', 'si', 'null', '<p>Bogot&aacute; D.C. 23 de Julio 2023</p>\r\n\r\n<p>Verificaci&oacute;n de notificaciones.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Se verifica la notificaci&oacute;n por correo y por plataforma.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Att: Miguel Angarita</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, 'si', 'usuario', '[\"5\"]', 'Aprobado', 'Acta Aprobada, listo parar verificación de correos', 1, 0, 0, NULL, '1016050102C', NULL, '', ''),
(4, 'Revisión de acta, comentarios desde el cargo', 13, 'Actas', '2023-06-22 15:26:00', '2023-06-23 19:29:00', 'usuario', '[\"3\"]', 'usuario', '[\"3\"]', '', '', 'null', 'usuario', '[\"5\",\"3\"]', 'usuario', '[\"5\",\"3\"]', '\",,,,,,,,,\"', '\",,,,,,,,,\"', '\",,,,,,,,,\"', '\",,,,,,,,,\"', '', 'si', 'null', '<ol>\r\n	<li>En los asuntos de los correos llega en ambos roles, tanto el del responsable como el aprobador, como figura en la siguiente imagen <img src=\"data:image/png;base64,\" style=\"height:137px; width:515px\" /></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Debe llegar en el rol del responsable, encargado para gestionar el compromiso y en el rol del aprobador, encargado para aprobar el compromiso</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Desde la opci&oacute;n de agregar el comentario, permite agregar m&aacute;s comentarios, siempre y cuando no me salga de esta ventana, se debe verificar, al igual que las dos ventanas o opciones que tiene una de agregar el documento adjunto del compromiso ejecutado y el otro de agregar el comentario.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Al subir el encabezado del acta, es decir la imagen, para poder copiar la URL, seg&uacute;n las instrucciones del manual, no hay un bot&oacute;n que, de la opci&oacute;n de volver hacia atr&aacute;s, para pegar la URL l de la imagen, como se evidencia en la siguiente imagen (El bot&oacute;n de subir imagen es una pesta&ntilde;a aparte, para subir una foto al sistema y poderla pegar en el agregar o editar encabezado, para no perder la informaci&oacute;n que se ha digitado en el nombre o visor HTML)</li>\r\n</ol>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, 'si', 'usuario', '[\"5\"]', 'Aprobado', 'El acta de aprueba, para revisión de compromisos, comentarios desde los cargos', 1, 0, 0, NULL, '1016050102C', NULL, '', '');

