INSERT INTO `definicion` (`id`, `nombre`, `nombreN`, `definicion`, `fuente`) VALUES
(1, 'TECHÓ', NULL, '\nTECHÓ es una organización apartidista, y a través de todo el trabajÓ de voluntarios y habitantes de asentamientÓs, busca hacer política y generar incidencia, cÓn el objetivo de cambiar la situación de pobreza en que viven millones de persÓnas en la región.', 'https://techo.org/preguntas-frecuentes/#:~:text=TECHO%20es%20una%20organizaci%C3%B3n%20apartidista,de%20personas%20en%20la%20regi%C3%B3n.\n'),
(2, 'panelitas de leche', NULL, 'Leche, crema de leche, bicarbonato, azúcar y harina de arroz son algun los de sus ingredientes para poder llevarla a la mesa\"\n', 'https://www.elespectador.com/gastrono \'mia-y-recetas/receta-asi-se-preparan-las-panelitas-de-leche/'),
(3, 'comas y comillas', NULL, 'Se recomienda usar en primera instancia las comillas angulares o españolas (), reservando las inglesas () y las simples (), en este orden, …\n', 'https://www.rae.es/espanol-al-dia/cuando-se-usa-cada-tipo-de-comillas'),
(4, 'DEFINICION', NULL, 'estracto', 'vancario 123564477\'\'\'\'\'\''),
(5, 'JAGUARES 2', NULL, 'EQUIPO DE TRASMISION TELEVISIVA', 'AUTOR66\"\"!'),
(6, 'comas', NULL, 'Unas veces, cuando escribimos, necesitamos reproducir directamente palabras o pensamientos ajenos. Otras veces nos interesa llamar la atención acerca de una palabra o expresión del texto que pertenece a otro registro o a otra lengua, o que se usa con algún sentido especial. No es nada raro que pasen ambas cosas a la vez; es decir, que estas voces especiales aparezcan en el interior de un discurso que queremos transcribir literalmente. Pero ¿qué sucede cuando hay que citar un fragmento que a su vez contiene otra cita en cuyo interior aparece alguna de estas voces peculiares? En esos casos entran en juego los tres tipos de comillas del español', '');

